// App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PrivateRoute from "../src/IoT/privateRoute";
import { LogInIndex } from "./IoT/logInIndex";
import { WelcomeBody } from "./IoT/welcomeBody";
import { Meniu } from "./IoT/meniu";

function App() {
  return (
    <div className="header-welcome-padding">
      <Router>
        <Routes>
          <Route path="/login" element={<LogInIndex />} />
          <PrivateRoute path="/welcome" element={<WelcomeBody />} />
          <PrivateRoute path="/meniu" element={<Meniu />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
